.text
.globl _start
.set noat
.set noreorder
.ent _start

_start:


addi $s0, $zero, 0			#counter for first loop
addi $s1, $zero, 0			#counter for outer loop
addi $s2, $zero, 0			#counter for inner loop

li $t4, -1
addi $s3, $zero, 16			#s3=n

sll $s4, $s3, 2				#s4=s3*4 - for going to the next line of array
mul $s5, $s4, $t4			#s5=-s4 - for going back one line

mul $s6, $s5, $s3			#(n*n*4) - for finding the end of array (negative number)
addi $s6, $s6, 4			# for returning to the begining of the array 


la $t4, key	
la $t6, array_x 			
la $t7, array_y
la $t5, array_z


Loop:
	beq $s0, $s3, out
	
	outer:
		beq $s1, $s3, out2
		
		
		inner:		beq $s2, $s3, out3
			
				lw $t0, 0 ($t6)				#load element of x
				lw $t1, 0 ($t7)				#load element of y
				mul $t3, $t0, $t1			#multiply them
				addu $t9, $t2, $t3			#add the product to sum 
				
				#check ovf 
				xor $t8, $t2, $t3			#check if signs are different
				slt $t8, $t8, $zero			#t8=1 different signs
				bne $t8, $zero, no_ovf			#sign of t9 != sign of t3 -> no overflow
									#continue to the next element 
				xor $t8, $t9, $t2			#t3=negative if signs are different
				slt $t8, $t8 , $zero			#t8=1 if sum sign different
				bne $t8, $zero, exit			#if overflow exists, exit

		no_ovf:		addi $t6, $t6, 4			#next element of x
				add $t7, $t7, $s4			#get the next element of the same column
				addi $s2, $s2, 1			#increase loop counter
				add $t2, $t9, $zero			#move sum to t2
				j inner
  
		out3:   	sw $t2, 0 ($t5)				#store result in array z
		    		addi $t5, $t5, 4			
		    		addi $t2, $zero, 0
		    
				add $t6, $t6, $s5			#go back one line
				add $t7, $t7, $s6			#go to the starting point of array y
				addi $s1, $s1, 1			#increase loop counter
				addi $s2, $zero, 0
	       			j outer
	    
	out2:		add $t6, $t6, $s4				#go to next line
			add $t7, $t7, $s5				#go back one line
			addi $s1, $zero, 0				
    			addi $s0, $s0, 1				#increase loop counter
    			j Loop
    			nop

     
	#search
out:	la $t5,array_z				
	lw $s5, 0($t5)							#s5 = first element of z
	lw $t0, 0($t4)							#t0=key
	addi $s0, $zero, 0 						#how many times number is going to be found
	addi $s1, $zero, 0						#loop counter
	mul $s2, $s3, $s3						#s2=n*n
	
search:	beq $s1, $s2, exit						#search the whole array
	
	bne $s5, $t0, count						#if s5 != key, continue
	addi $s0, $s0, 1						#else you found the key

count:	addi $t5, $t5, 4						#go to the next elemeny
	addi $s1, $s1,1							#increase loop counter
	lw $s5, 0($t5) 							
	j search

exit:	li $v0, 10
	syscall	
    
.end _start

